import ReactDom from 'react-dom';

function Greeting(){
  return(
    <div>
      <h3> <Person/> </h3>
      <h3> Web Developer </h3>
    </div>
  )
}

const Person = () => <h1> Jon Snow </h1>;
const msg = () => {return (<h1> Web Develoer </h1>)};

